import React from 'react'
import styled from 'styled-components'

const Logo = styled.div`
animation-duration: 3s;
animation-name: slidein;
@keyframes slidein {
from {
  margin-left: 100%;
  width: 300%
}
to {
  margin-left: 0%;
  width: 100%;
}
`

const ContainerHead = styled.div`
height: 40px;
`


export default function Header () {

    return (
        <ContainerHead>
        <Logo>
        logo
        </Logo>
        </ContainerHead>
    )

}
